// Profile.js
import React, { useState, useEffect } from 'react';
import { getDoctorProfile } from '../services/api'; // Adjust the import path based on your folder structure

const Profile = () => {
  const [profileData, setProfileData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch the doctor's profile when the component is mounted
    const fetchProfile = async () => {
      try {
        const response = await getDoctorProfile();
        setProfileData(response);
      } catch (err) {
        setError('Failed to fetch profile data.');
      } finally {
        setLoading(false);
      }
    };

    fetchProfile();
  }, []);

  if (loading) return <div>Loading...</div>;

  if (error) return <div>Error: {error}</div>;

  return (
    <div>
      <h1>Doctor Profile</h1>
      {profileData ? (
        <div>
          <p><strong>Name:</strong> {profileData.name}</p>
          <p><strong>Email:</strong> {profileData.email}</p>
          <p><strong>Specialization:</strong> {profileData.specialization}</p>
          {/* Render other profile details as needed */}
        </div>
      ) : (
        <p>No profile data available.</p>
      )}
    </div>
  );
};

export default Profile;
